column13:
Composés à activité pesticide de formule (I)
  ou l'un de ses sels, dans lequel Q est un système à noyau monocyclique ou un système à noyau condensé bicyclique, éventuellement substitués, dans lequel au moins un noyau est aromatique ou Q est un groupe dihalogénovinyle ou un groupe R 6 C≡C-, dans lequel R 6  est C 1-4 -alkyle, triC 1-4 -alkylsilyle, halogène ou hydrogène ;
 Q 1  est un noyau 1,2-cyclopropyle, éventuellement sub-stitué par un ou plusieurs groupe(s) choisi(s) parmi C 1-3 -alkyle, halogène, C 1-3 -halogénoalkyle, C 1-3 -alkynyle, ou cyano; ou Q 1  est (CH 2 ) m , dans lequel m = 1 à 7 ; a = 0 ou 1 ; b = 0 ou 1 ; R 2 , R 3 , R 4  et R 5  sont identiques ou différents, l'un d'eux au moins étant hydrogène et les autres étant choisis indépendamment parmi hydrogène, halogène, C 1-4 -alkyle ou C 1-4 -halogénoalkyle; X 1  est oxygène ou soufre ; R 1  est un système à noyau hétéroaromatique ou partiellement saturé, à cinq ou six chaînons, contenant un minimum d'un et jusqu'à quatre hétéroatomes choisi(s) individuellement parmi l'azote, le soufre et l'oxygène, ou R 1  est un système à noyau saturé à cinq ou six chaînons, contenant un ou plusieurs hétéroatome(s) choisi(s) individuellement parmi l'azote, l'oxygène et le soufre ; sont décrits ainsi que leurs procédés de préparation, les composés intermédiaires utilisés dans leur préparation, les compositions pesticides qui les contiennent, et leur utilisation contre des parasites.
